import React, {Component} from 'react';
import 'antd/dist/antd.css'; // or 'antd/dist/antd.less'
import { Card, Descriptions, Statistic, Progress, Row, Col } from 'antd';
import {recipeData} from './data';
//import data from './src/data.json';
export const recipe = () => {
            return(
                <>
                    <div className='recipeContainer'>
                        {recipeData.map((data,key) => {
                            return(
                                <div key={key}>
                                    {data.item + 
                                    " , " +
                                    data.kcal +
                                    " , " +
                                    data.picture}
                                </div>
                            );
                        })}
                    </div>
                </>
            );
        };

const HomePageHeader = () => {
  return (
    <header className="header">
      <h2>Your Recipe Tracker</h2>
    </header>
  );
};

const Stock = ({ item, kcal, picture }) => {
  if (!item) return <div />;
  return (
    <table>
      <tbody>
        <tr>
          <td>
            <h5>{item}</h5>
          </td>
          <td>
            <h5>{kcal}</h5>
          </td>
          <td>
            <h4>{picture}</h4>
          </td>
          <td>
            <p>{item}</p>
          </td>
        </tr>
      </tbody>
    </table>
  );
};
